import React from 'react'
import { Button } from 'react-bootstrap'
import { Card } from 'react-bootstrap'
import { useSelector } from 'react-redux'


const LastYearMovies = () => {
    const movies = useSelector((state) => {
        return state.movies.Search
    })


    return (
        <div>
            {movies ? movies.map((movie) => {
                return (<Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" src={"https://m.media-amazon.com/images/M/MV5BNjM0NTc0NzItM2FlYS00YzEwLWE0YmUtNTA2ZWIzODc2OTgxXkEyXkFqcGdeQXVyNTgwNzIyNzg@._V1_SX300.jpg"} />
                    <Card.Body>
                        <Card.Title>{movies[0].Title}</Card.Title>
                        <Card.Text>
                            Some quick example text to build on the card title and make up the bulk of
                            the card's content.
                        </Card.Text>
                        <Button variant="primary">Go somewhere</Button>
                    </Card.Body>
                </Card>)
            }) : null}
        </div>
    )
}

export default LastYearMovies;
